import React from 'react';
import './mainImageContent.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faArrowDown, faArrowLeft, faArrowRight, faArrowUp} from "@fortawesome/free-solid-svg-icons";

const mainImageContent = () => {
    return ( 
        <div className={'MainImageContent'}>
            <h3>This is our great company.</h3>
            <FontAwesomeIcon icon={faArrowUp} className="fa-3x" style={{zIndex: '50', color: 'white', margin: 5}} />
            <FontAwesomeIcon icon={faArrowDown} className="fa-3x" style={{zIndex: '50', color: 'white'}} />
            <FontAwesomeIcon icon={faArrowRight} className="fa-3x" style={{zIndex: '50', color: 'white'}} />
            <FontAwesomeIcon icon={faArrowLeft} className="fa-3x" style={{zIndex: '50', color: 'white'}} />
        </div>
     );
}

export default mainImageContent;
